const validation = (userData) =>{
        let errors = {};

        if(!/^[^\s@]+@[^\s@]+\.[^\s@]+$/.test(userData.username)){
            errors.username = 'El email es invalido';
        }
        if(!userData.username){errors.username = 'No tiene que estar vacio'}

        
        

        return errors;
}
export default validation;
